const char* custom_html_style = R"raw(
<style>
  /* --- 1. CSS GAYA TAMPILAN (DARK MODE) --- */
  body {
    background-color: #1e2027; 
    color: #e0e0e0;            
    font-family: 'Verdana', sans-serif;
  }
  
  /* Judul */
  h1 {
    color: #4cc9f0;            
    text-align: center;
    font-size: 24px;
    text-transform: uppercase;
    margin-bottom: 10px; /* Jarak ke logo dikit aja */
  }

  /* Tombol */
  button {
    background-color: #4361ee; 
    color: white;
    border: none;
    padding: 12px 24px;
    border-radius: 50px;       
    font-size: 16px;
    font-weight: bold;
    cursor: pointer;
    width: 100%;
    margin-top: 10px;
  }
  button:hover {
    background-color: #3f37c9; 
  }

  /* Kotak Input */
  input {
    background-color: #16213e;
    color: #ffffff; 
    border: 1px solid #4cc9f0;
    padding: 10px;
    border-radius: 5px;
    width: 95%;
  }

  /* Link Nama WiFi */
  a {
    color: #ffffff;       
    text-decoration: none; 
    font-size: 16px;
    display: inline-block;
    margin: 5px 0;
    width: 70%; 
  }
  
  /* Icon WiFi & Gembok jadi PUTIH */
  .q, .l { 
    filter: invert(100%);      
    -webkit-filter: invert(100%); 
  }
  .q {
    float: right;
    margin-top: 5px;
  }

  /* --- 2. CSS KHUSUS LOGO TAMBAHAN --- */
  .logo-web {
    display: block;
    margin: 0 auto 20px auto; /* Posisi tengah, kasih jarak bawah 20px */
    width: 100px;             /* Ukuran lebar logo (bisa lu atur) */
    height: auto;
    border-radius: 10px;      /* Opsional: biar sudut gambarnya tumpul */
  }
  
  .info { display: none; }
</style>

<script>
  // --- 3. SCRIPT UNTUK MENYISIPKAN LOGO ---
  window.onload = function() {
    
    // === [BAGIAN INI YANG HARUS LU ISI] ===
    // Masukkan kode panjang hasil convert Base64 di antara tanda kutip dua ""
    // Jangan hapus "data:image/png;base64," di depannya kalau kodenya belum ada header itu.
    
    var base64logo = "data:image/png;base64,"; 
    
    // Logika nempelin gambar ke HTML
    var logoImg = document.createElement('img');
    logoImg.src = base64logo;
    logoImg.className = 'logo-web'; 
    
    // Cari elemen Judul (h1)
    var title = document.querySelector('h1');
    
    // Tempel gambar SETELAH judul (sebelum form login)
    if(title) {
      title.parentNode.insertBefore(logoImg, title.nextSibling);
    }
  };
</script>
)raw";